import React from "react";
import Chip from "@mui/material/Chip";
import Stack from "@mui/material/Stack";

const Shifter = (props) => {
    const timeEmloyee = props.time - props.employee;
  return (
    <Stack spacing={7}>
      <Chip
        label={timeEmloyee}
        variant="outlined"
        color="success"
      />
    </Stack>
  );
};

export default Shifter;
